from collections import defaultdict, deque
from typing import List


class Solution:
    def minJumps(self, arr: List[int]) -> int:
        valueToIdxes = defaultdict(set)
        for idx,val in enumerate(arr):
            valueToIdxes[val].add(idx)

        n = len(arr)
        dp = [float('inf')] * n

        q = deque()
        q.append((n-1, 0))

        while q:
            i,cost = q.popleft()
            if dp[i] <= cost:
                continue
                
            dp[i] = cost 

            if i>0:
                q.append((i-1, cost+1))
            if i<n-1:
                q.append((i+1, cost+1))
            for idx in valueToIdxes[arr[i]]:
                if idx!=i:
                    q.append((idx, cost+1))
        
        return dp[0]

